import React, { useEffect, useState } from "react";
import axios from "axios";
import "./App.css";

const App = () => {
  const [student, setStudent] = useState([]);
  const loadStudent = async () => {
    await axios
      .get("http://localhost:5000/api/getInfo?_limit=10")
      .then(({ data }) => {
        console.log(data);
        const allStudent = [];
        data.forEach((s) => {
          allStudent.push({ name: s.email, email: s.name });
        });
        setStudent(allStudent);
      });
    console.log(student);
  };
  useEffect(() => {
    loadStudent();
  }, []);
  return (
    <div>
      <h1>Hi</h1>
    </div>
  );
};

export default App;
